import './App.css';

const Person = (props) => {
	return (
		<>
			<h1>name: {props.name}</h1>
			<h2>last name: {props.lastName}</h2>
			<h2>age: {props.age}</h2>
		</>
	)
}

const Counter = () => {
	let value = 0;
	return (
		<>
			<button onClick={(value) => value + 1}>+</button>
			<p>{value}</p>
			<button onClick={(value) => value - 1}>-</button>
		</>
	)
}

const App = () => {
	const name = "Bob"
	let showName = false;
	return (
		<div className='App'>
			<Counter />
			<Person
				name={'John'}
				lastName={'Doe'}
				age={'30'}
			/>
			<Person name={'Bob'} lastName={'Someone'} age={'35'} />
		</div>
	)
}

export default App;
